INSERT INTO `tbigk_foremjobs_jobs` (`jbs_id`, `jbs_guid`, `jbs_title`, `jbs_from_id`, `jbs_contract_id`, `jbs_category_id`, `jbs_treated`, `jbs_type_id`, `jbs_status_id`, `jbs_enterprise_id`, `jbs_contact_id`, `jbs_printable`, `jbs_user_id`, `jbs_description`, `jbs_summary`, `jbs_salary`, `jbs_path`, `jbs_Create_At`, `jbs_Update_At`) VALUES
(1, '{9673E54B-6EA1-DD85-8F56-29421F36D7F8}', 'Software Developer .NET', 7, 1, 2, NULL, 1, 2, 58, NULL, 1, 1, NULL, ' Ã propos de lâoffre dâemploi\r\n\r\nDornan are currently recruiting for an ICT Project Manager to work on site in Belgium.\r\n\r\nDornan are a leading Mechanical, Electrical and Instrumentation contractor with projects in Ireland, Mainland Europe, and the UK.\r\n\r\nDornan are involved in projects across many sectors such as Pharmaceutical, Data Centre, Healthcare, Education, Commercial, and Power Generation\r\n\r\nYou will join a hard-working ambitious team and you will benefit from a supportive culture, where your ideas and contributions will be recognised.\r\n\r\nThe successful candidate will join an already established team on the construction phase of this landmark project.\r\n\r\nRoles and responsibilities:\r\n\r\n    Undertake the role of a project leader within the project team with responsibility for management of people, commercial issues and an interface with the wider project team.\r\n    Co-ordinate project team including 3rd party stakeholders towards achieving common goals for the project\r\n    Chair project meetings and provide progress reports and schedule updates directly to the client.\r\n    Ensure best in class EHS processes are implemented and maintained through the full life cycle of the project.\r\n    Develop and lead QA/QC processes from design co-ordination through to handover, in line with client expectations.\r\n    Build strong relationships with client team.\r\n    Early identification and effective management of project risks.\r\n    Client and 3rd party stakeholder management.\r\n    Provide On-Site Project Management for Structured Cabling Infrastructure Implementation.\r\n    Promoting company wellbeing & inclusion values.\r\n    Validate design & Develop âBill of materialsâ.\r\n    Chair project meetings and provide progress reports and schedule updates directly to the client\r\n    Ensure best in class EHS processes are implemented and maintained through the full life cycle of the project\r\n\r\nExperience:\r\n\r\n    5 + years of experience in the datacenter/pharmaceutical environment (preferable but not essential), designing, implementing and certifying structured cabling systems & electronic security systems.\r\n    Experience in all of the following areas is highly desirable:\r\n    Registered communications distributed engineer (RCDD).\r\n    Bachelor\'s degree in Construction Management or equivalent.\r\n    Project Management certification such as PMP and/or Prince2.\r\n    Strong background in network infrastructure testing & verification.\r\n    Knowledge of high-end product sets such as Corning & Panduit.\r\n    Broad knowledge of Telecommunications standards.\r\n    High level client interface.\r\n    Other MEP Systems.\r\n\r\nQualifications:\r\n\r\nWhy Dornan? \r\n\r\n    Dornan are a well-established company with a family feel and a down to earth team\r\n    Dornan offer a clear progression path , always seeking opportunities to promote from within\r\n    Dornan offer educational assistance and promote CPD\r\n    Dornan promote collaboration through various team building , social and charity events\r\n    Dornan are committed to employee wellbeing with our Employee Assistance Programme and an in house Health & Wellbeing advisor\r\n\r\nWhy Dornan?\r\n\r\nOur commitment to our employees development - we offer career progression pathways, always seeking opportunities to promote and upskill our people.\r\n\r\nHealth & Wellbeing - Fostering health and wellbeing is paramount to creating a supportive and inclusive work environment. Our commitment to mental health manifests through targeted workshops. We have a Health & Wellbeing Calendar, our Employee Assistance Programme, and the formation of a Wellbeing Network comprising over 80 trained Mental Health First Aiders.\r\n\r\nCorporate Social Responsibility - We embrace our role in shaping a sustainable future and understand the significance of our impact. We are committed to delivering leadership in sustainability as ESG Citizens. With our expertise, we strive to reduce the environmental footprint of the communities we serve.\r\n\r\nBenefits â from helping you to plan for the future to Health & Wellbeing services we continue our commitment to support our people\r\n\r\nDiversity & Inclusion\r\n\r\nWe believe your career should only be limited by your own ambition. At Dornan we are proud of our dynamic workforce and will continue to recruit people from a variety of backgrounds, cultures and beliefs. Because we know that diverse organisations perform better. ', NULL, NULL, '2023-01-02 00:00:00', '2025-04-14 08:55:47'),
(2, '{D426F3D5-3857-CFE1-68F2-7CE26D4C8F39}', 'IT Cloud / DevOps Project Manager (Agile / Waterfall)', 1, 1, 1, NULL, 1, 2, 52, NULL, 1, 1, 'Contracts IT - IT Cloud / DevOps Project Manager (Agile / Waterfall)\r\nAn exciting opportunity for a truly global organisation based in Brussels, Belgium. They urgently need an IT Project Manager, ideally who has some experience around Cloud/DevOps domains, whilst managing various Software Development projects and more! Please share your CV & motivation for immediate consideration to Javaid - we are shortlisting for interviews now! See the description below.\r\n \r\n \r\nRequired experience & skills\r\n \r\nProject management & IT expertise:\r\n    3+ years of IT Project Management experience.\r\n    Strong understanding of IT development and experience in an IT organization.\r\n    Ability to manage multiple development projects simultaneously while tracking operational phases.\r\n    Experience with Agile, Scrum, Kanban, Waterfall, CPM, and PMBOK methodologies, with the ability to select the best approach per project.\r\n    Deep expertise in Agile principles (Scrum Master, Agile Coach).\r\nTechnical & reporting skills:\r\n    Proficiency in Microsoft Office Suite, Atlassian Suite (Jira & Confluence), and ServiceNow.\r\n    Strong reporting skills, including dashboard creation and milestone tracking.\r\n    Experience with project planning in fast-changing environments, including budgeting and resource management.\r\nSoft skills & leadership:\r\n    Proven ability to work in a multi-cultural, multi-functional environment.\r\n    Customer and end-user focused mindset.\r\n    Excellent verbal and written communication skills .\r\n    Demonstrated leadership skills to motivate teams and drive deliverables.\r\n    Strong analytical mindset, identifying information gaps and finding solutions.\r\n    Ability to work both independently and in a team setting.\r\nPreferred skills:\r\n    Background in software development.\r\n    Experience with MS Project or other GANTT software.\r\n    Working experience in an international context and with remote teams.\r\n    Data analysis skills to quantify performance and project results.\r\nLanguages:\r\n    Fluent English (spoken & written).\r\n    Dutch is a plus.\r\n \r\nPlease send your CV or call javaid to discuss further.\r\nWe are an equal opportunities employment agency and welcome applications from all suitably qualified persons regardless of race, sex, disability, religion/belief, sexual orientation, or age.\r\nWe champion differences in technology recruitment and work with clients who actively wish to diversify their talent force - all applicants are welcome to apply.\r\nCompany ', 'IT Cloud / DevOps Project Manager (Agile / Waterfall) Contracts IT 03/04 Brussels CPM, PMBOK, Jira, Confluence ', NULL, NULL, '2025-04-13 00:00:00', '2025-04-13 22:38:07'),
