(1109, '{FD709B96-E580-29C8-6423-BF708D7E5FB0}', 'PHP DEVELOPER', 1, 1, NULL, NULL, 1, 2, 74, NULL, 1, 1, 'Job Title: Full Stack Developer \r\nContract Duration: As soon as possible - 30/06/2025\r\nWork Location: 1020 Brussels \r\nRemote Status: Hybrid \r\nLanguages: English, French OR Dutch \r\n\r\nRole Overview\r\nThe Full Stack Developer will be responsible for developing and maintaining internal applications across front-end, middle-tier, and back-end layers. This includes:\r\nâ¢	Designing and implementing new applications in collaboration with the IT team and relevant departments.\r\nâ¢	Ensuring compatibility of software systems through interface development.\r\nâ¢	Conducting audits and redesigning applications to optimize performance.\r\nâ¢	Providing ongoing maintenance and user support for internal systems.\r\nKey Responsibilities\r\nApplication Development & Maintenance\r\nâ¢	Full Stack PHP Development: Develop applications using the Laravel framework, covering backend logic, database management, and front-end development (HTML/CSS/JS).\r\nâ¢	Git Version Control: Manage repositories, branches, merges, and pull requests within collaborative projects.\r\nâ¢	Integration with DevOps Processes: Ensure seamless integration into the team\'s DevOps workflow.\r\nâ¢	VueJS Development: Build reusable components for the Vuemann intranet framework.\r\nâ¢	Automated Front-End Testing: Implement and maintain Jest and Cypress tests to ensure robustness.\r\nâ¢	Application Audit & Redesign: Analyze and optimize existing PHP code, identifying dependencies and database structures.\r\nâ¢	Database Management (MySQL): Perform modeling, queries, and migrations for core business and intranet applications.\r\nâ¢	Technical Documentation: Write user and developer documentation to enhance maintainability.\r\nâ¢	Production Bug Fixes & Support: Resolve issues, collaborating with hospital users.\r\nâ¢	Business Interface Development: Design ergonomic interfaces for HR departments, invoicing, and other non-technical audiences.\r\nSkills & Expertise Required\r\nTechnical Expertise\r\nâ¢	PHP with Laravel Framework\r\nâ¢	VueJS or Equivalent Front-End Framework\r\nâ¢	HTML/CSS/JS\r\nâ¢	MySQL Database Management\r\nâ¢	Git Version Control & Collaboration\r\nâ¢	Automated Testing (Jest, Cypress)\r\nâ¢	Application Security & Data Protection\r\nâ¢	Software Installation & System Configuration\r\nInterpersonal & Professional Skills\r\nâ¢	Autonomy & Organization\r\nâ¢	Strong Analytical & Problem-Solving Skills\r\nâ¢	Customer-Oriented Mindset\r\nâ¢	Effective Communication Skills (written & oral)\r\nâ¢	Collaboration & Teamwork\r\nâ¢	Ability to Translate T', 'Dear professional\r\nHope you are doing great\r\nI am Surya from Onesource\r\nWe have opening for the role of PHP DEVELOPER\r\nI am mentioning the job description in the attachment\r\nPlease have a view and reach me for more information\r\n \r\n \r\nThanks & Kind Regardsâ¦\r\nSurya Kuruganti\r\nTalent Acquisition Specialist\r\nNew Logo\r\nM: + 32 25863763 | P: +32 28860545\r\nA: Avenue Henry Dunant 38/2 - 1140 - Evere, Belgium\r\nE: surya@onesource.one | W: www.onesource.one\r\n \r\nWe respect GDPR and your details will be leveraged for the purpose of recruitment processes alone. If you are not interested to receive our emails, please revert back to us by mentioning REMOVE in the subject line.', NULL, NULL, '2025-04-07 00:00:00', '2025-04-14 12:12:27'),
(1110, '{02B4862D-95FC-4982-14D4-A67DA75702C7}', 'Junior Sofware / Web Developer ', 7, 1, NULL, NULL, 1, 2, 75, NULL, 1, 1, 'As a Junior Software/Web Developer, your mission is to develop, update and continuously improve our management software Adfinity & Smartsales. Your job is not limited to programming. You also have a role to play in the analysis and reflection of future development needs.\r\n\r\nAnd if you like this job, you might as well do it in the Best Workplace of Belgium since 2015 ;-)\r\n\r\nResponsibilities\r\n\r\nEasi values training. As soon as you join us, you\'ll receive a solid training and coaching tailored to your development skills:\r\n\r\nThe programming languages we develop with (Angular, Java, Go, PHP, .NET, Windev, SQL)\r\nAll the functionalities of our applications \r\n\r\nAfter This Training, You Will\r\n\r\nCollaborate in the development of our tools in our R&D team\r\nRespond to the technical and functional needs of our consultants for our projects\r\nCreate new modules for our applications following regular meetings with the project manager\r\nBecome an internal reference for the technical and functional aspects of our applications\r\n\r\nProfile\r\n\r\nMust-have\r\n\r\nBachelor or Master in IT\r\nFluent in French (C2 level)\r\nPassionate about IT and related fields\r\nGood knowledge of programming languages and open to discovering new ones\r\nBusiness oriented, interested in the functional side of development\r\nProactive\r\nTeamplayer\r\n\r\nComfortable with commuting to our Nivelles office. \r\n\r\nNice-to-have\r\n\r\nExisting knowledge of Angular, Java, Go, PHP, .NET, Windev, SQL\r\nGood knowledge of English\r\nBilingual NL/FR\r\n\r\nBenefits\r\n\r\nCompetitive salary package with fringe benefits:\r\n\r\nCompany car with fuel and/or charging card for unlimited use in Belgium\r\nMeal vouchers\r\nEco-vouchers\r\nHospitalization insurance Alan: innovative, transparent and paperless health partner. Possibility to add ambulatory and dental insurance (specialists, doctors, dentists,...) at a lower cost than if taken separately\r\nGroup insurance\r\nMobile phone subscription\r\nSeniority days\r\nPlatform for converting the end-of-year bonus into additional, personalised benefits \r\n\r\nA Fun And Stimulating Work Environment\r\n\r\nTransparent communication\r\nModern, wellbeing-oriented offices\r\nA young, dynamic and forward-looking management\r\nEvents: business trips abroad, sports and team building events, gala evenings, etc.\r\nFresh fruit, free breakfast once a month, gaming room (darts, PlayStation, board games, kicker table,...), afterwork every Friday, and â¦ strong coffee ;-) \r\n\r\nOpportunities\r\n\r\nOpportunity to grow rapidly, both vertically and horizonta', 'Nivelles', NULL, NULL, '2025-04-04 00:00:00', '2025-04-14 12:16:35'),
