(1112, '{3FD5F64E-4204-C74A-3BE9-7C6DFF2A1A95}', 'DÃ©veloppeur PHP', 7, 1, NULL, NULL, 1, 2, 77, NULL, 1, 1, 'Ã propos de lâoffre dâemploi\r\n\r\nAs a senior developer:\r\nâ¢ You are able to analyse and estimate the complexity and the time needed to develop new functionalities. \r\nâ¢ You Develop solutions to meet business requirements using new or existing technologies in collaboration with your squad, made of frontend devs, DevOps and other backend devs.\r\nâ¢ You take part in the product design during all scrum-meetings (poker, sprint-planning, ...), you can easily adapt to complex software architecture.\r\nâ¢ Get the most of our technological stack to increase software availability, resource efficiency, and make sure our platforms can scale & support any peak load.\r\nâ¢ Collaborate & share your knowledge with other teams such as support, platform and project-managers to ensure the good quality and evolution of the software\r\n\r\nYour profile :\r\nâ¢ Graduate, Bachelor, or Master in computer science or equivalent by experience.\r\nâ¢ 2-3 year Experience in PHP, rest services, Zend framework knowledge is a plus.\r\nâ¢ Experience with SQL databases such as PostgreSQL\r\nâ¢ Basic experience with SCM such as Git or SVN (we â¥ Gitlab & Gitlab-CI)\r\nâ¢ Experience with Docker is a plus. Kubernetes is a plus-plus-plus :)\r\nâ¢ Experience with Javascript and Dojo Framework is a plus\r\nâ¢ You have a good sense of humor (mandatory)\r\nâ¢ Youâre fluent in French and can sustain a basic technical conversation in English\r\n\r\nOur stack : \r\nInfra: \r\n- OpenStack\r\n- Kubernetes\r\n- Docker\r\nOrange Tucano Stack:\r\n- Postgressql 12\r\n- ElasticSearch 7\r\n- RabbitMQ\r\nOther apps:\r\n- PHP\r\n- Javascript\r\n- Dojo Framework', NULL, NULL, NULL, '2025-02-19 00:00:00', '2025-04-14 12:25:00'),
(1113, '{7E1BF580-91C8-A73B-B5AA-68322ADA491A}', 'Ingenieur informatique', 1, 1, 2, NULL, 1, 2, 33, NULL, 1, 3, ' Responsibilities:\nâ¢ Gather and analyze business needs in collaboration with Product Owners and IT teams.\nâ¢ Write detailed functional specifications.\nâ¢ Design tailored solutions around platforms such as Solife and BDU.\nâ¢ Draft technical requirements and conduct joint technical analysis with stakeholders (IT, vendors, etc.).\nâ¢ Follow development activities and ensure final deliverables align with initial requirements.\nâ¢ Drive test strategies, support user acceptance testing, and lead change management initiatives.\nâ¢ Provide ongoing functional support post-deployment.\nRequired Skills:\nâ¢ Proven experience as an IT Business Analyst, ideally within Luxembourg life insurance.\nâ¢ Strong command of tools such as SQL, JIRA, Excel, and test platforms (e.g. Octane).\nâ¢ Capable of mapping data flows and system lineage end-to-end.\nâ¢ Familiar with analysis and modeling methodologies (e.g. BPMN, SWOT) and Agile frameworks.\nâ¢ Excellent analytical, writing, and communication skills.\nâ¢ Team player with strong organization and multitasking abilities.', NULL, NULL, NULL, '2024-07-10 00:00:00', '2025-04-29 12:45:39'),
