(1204, '{9A8A5531-86AB-8F47-EBB9-D0B8C137A5E8}', 'Analyste Fonctionnel IT', 1, 1, 2, NULL, 1, 2, 33, NULL, 1, 3, ' Responsibilities:\nâ¢ Gather and analyze business needs in collaboration with Product Owners and IT teams.\nâ¢ Write detailed functional specifications.\nâ¢ Design tailored solutions around platforms such as Solife and BDU.\nâ¢ Draft technical requirements and conduct joint technical analysis with stakeholders (IT, vendors, etc.).\nâ¢ Follow development activities and ensure final deliverables align with initial requirements.\nâ¢ Drive test strategies, support user acceptance testing, and lead change management initiatives.\nâ¢ Provide ongoing functional support post-deployment.\nRequired Skills:\nâ¢ Proven experience as an IT Business Analyst, ideally within Luxembourg life insurance.\nâ¢ Strong command of tools such as SQL, JIRA, Excel, and test platforms (e.g. Octane).\nâ¢ Capable of mapping data flows and system lineage end-to-end.\nâ¢ Familiar with analysis and modeling methodologies (e.g. BPMN, SWOT) and Agile frameworks.\nâ¢ Excellent analytical, writing, and communication skills.\nâ¢ Team player with strong organization and multitasking abilities.', ' Responsibilities:\nâ¢ Gather and analyze business needs in collaboration with Product Owners and IT teams.\nâ¢ Write detailed functional specifications.\nâ¢ Design tailored solutions around platforms such as Solife and BDU.\nâ¢ Draft technical requirements and conduct joint technical analysis with stakeholders (IT, vendors, etc.).\nâ¢ Follow development activities and ensure final deliverables align with initial requirements.\nâ¢ Drive test strategies, support user acceptance testing, and lead change management initiatives.\nâ¢ Provide ongoing functional support post-deployment.\nRequired Skills:\nâ¢ Proven experience as an IT Business Analyst, ideally within Luxembourg life insurance.\nâ¢ Strong command of tools such as SQL, JIRA, Excel, and test platforms (e.g. Octane).\nâ¢